import styled from 'styled-components';

const HomeContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
`;

const BlogPost = styled.article`
  margin-bottom: 2rem;
  padding-bottom: 2rem;
  border-bottom: 1px solid #eee;
`;

function Home() {
  return (
    <HomeContainer>
      <h1>我的博客</h1>
      <BlogPost>
        <h2>示例博文标题</h2>
        <p>发布日期：2024-03-20</p>
        <p>这是博文内容的预览...</p>
      </BlogPost>
      {/* 可以添加更多的博文 */}
    </HomeContainer>
  );
}

export default Home;
